(function(){angular.module("registration",["ui.bootstrap"]).controller("RegController",["$scope","$window","$http",function(a,b,c){a.email=b.email;a.lunchers=b.lunchers;a.selected=a.lunchers[0];a.register=function(){c.put("/db/luncher/"+a.selected.id,{email:a.email}).success(function(a){b.location.href="/"}).error(function(a,c){b.alert("Registration failed. ("+c+") "+JSON.stringify(a))})}}])})();
